INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21717,'167','1','1040','310','<p>$200 for doctor certification + $50 for state registration</p>',null,'21718',null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21718,'167','1','1340','300','<p>There is a State Registration Fee waiver if you have SSI, SNAP, or MassHealth. State registration is normally done online now, you can register here: <a href="https://sso.hhs.state.ma.us/VGPortal/faces/SelfReg.jspx">MA State Registration&nbsp;</a></p><p>Any other questions regarding MA State registration fee pls. free to call DPH at 617-660-5370 or email at medicalmarijuana@state.ma.us</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21719,'167','1','1040','370','<p>$200 for doctor certification, and $50 to register with state ($25 if patient has Medicaid, SSI, SSDI, veterans disability)</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21720,'167','1','1040','420','<p>Doctor certification fees are $150 for New patients / $140 Renewal / $99 for Telemedicine users.</p><p>There is no State Registration fee in Maine.</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21721,'167','1','1040','480','<p>Doctor certification fee is $200. Patients that can show proof of low income will only pay $125. (Patient will need to bring either an EBT card, Husky D insurance card, or disability paperwork that documents that they are receiving monthly benefits from the state.)</p><p>The State Registration fee in Connecticut is $100. (This is in addition to the doctor certification fee)</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21722,'167','1','1040','540','<p>The doctor certification fee is $200 and the State registration fee in Maryland is.&nbsp;$50.</p><p>New patients are required to purchase a MMCC ID card at the time they register for their patient ID # effective 1/1/19.</p><p>Existing patients will be required to purchase a card for entrance into a dispensary.</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21723,'167','1','1040','590','<p>Doctor certification fee is $200 and there is a WA state registration fee of $100.</p><p>DC does offer a reduced fee of $25 with proof of the following:</p><ul><li>Valid Medicaid or DC Alliance</li><li>Documentation verifying total gross income is equal too or less than 200% of the federal poverty level.</li></ul>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21724,'167','1','1050','640','<p>Doctor certification fee in Delaware is $200 and there is a $125 State registration fee.</p><p>Effective July 2019 - The new State registration fee will be $50. This reduced Fee will be available for an income that is at or below 138% federal poverty line (have Medicaid)</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21725,'167','1','1050','690','<p>Doctor certification fee is $200 and the State registration fee in PA is $50.</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21726,'167','1','1050','740','<p>Doctor certification fee is $200 and the IL State registration fee is $100/1 year, $200/2 years, $250/3 years.</p><p>If patient is a veteran, or receives SSI or SSDI then the state applications fees are reduced by 50%.</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21727,'167','1','1040','790','<p>Ohio state registration fee is $50.</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21728,'167','1','1040','840','<p>The doctor certification fee is $200.</p><p>New York is currently waiving state registration fees for patients. Patients just need to click the bill me later option when registering.</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21729,'167','1','1040','910','<p>New patient certification fee with <strong>NO</strong> <strong>records</strong> cost $260</p><ul><li>$50 - pain exam (for records)</li><li>$50 - doctor certification</li><li>$150 ($75 if pt has snap) - state fee</li><li>$10 - upload fee</li></ul><p>New&nbsp;patients&nbsp;<strong>WITH records</strong> or renewal - cost is $210</p><ul><li>$50 - doctor certification</li><li>$150 ($75 if pt has snap) - state fee</li><li>$10 - upload fee</li></ul><p><strong>Discounts Available:</strong></p><p>- $10 off for all veterans</p><p>- $50 off for all dispensary agents</p><p>- $75 off for select dispensary agents (close partners)</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21730,'167','8','720','220','<p>Find your nearest Medical Marijuana Certification location.&nbsp;</p><p>If you are in <strong>New York</strong> or <strong>Canada</strong>, simply do it online with <a href="https://usebooking.sailcannabis.co/cannacaredocs/ebooking">Telemedicine</a></p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
