INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21745,'167','3','330','1270','<ul><li>Need state ID or drivers license</li><li>$200 for doctor certification / $50 for state registration</li><li>Medical records not required, but helpful</li><li>1st time patients need to come in for a 6 month follow up - at no extra cost.</li></ul>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
