INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21750,'167','1','640','1580','<ul><li>Massachusetts driver\'s license</li><li>Massachusetts ID card (must have photo)</li><li>U.S passport and another document that proves your MA residency OR</li><li>U.S Military ID and another document that proves your MA residency</li></ul>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21751,'167','1','630','1640','<p>A personal caregiver is someone who has agreed to assist with a registered patients medical use of marijuana. Caregivers must be 21 years of age and are required to register with the DPH online.&nbsp;</p><p>Qualifying patients are allowed two caregivers and caregivers are only allowed one patient. Caregivers may transport patients to an RMD, transport marijuana from an RMD on their behalf, and/or cultivate marijuana for a patient who has obtained a hardship cultivation registration.&nbsp;</p>',null,'21752',null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21752,'167','3','930','1620','<p>Would you like to know how to become a caregiver?</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21753,'167','5','10','10','Yes',null,'21755','21752',null,not('1'),null,'2019-05-10 13:29:24','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21754,'167','5','10','10','No, thanks',null,'21756','21752',null,not('1'),null,'2019-05-10 13:29:24','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21755,'167','1','1230','1740','<p>In order to register online as a caregiver, the caregiver MUST have the PIN number generated by the patient.</p><ul><li>Patient must log into their account on Virtual Gateway, click the caregiver tab, and click generate PIN. The patient then provides that PIN to a caregiver of their choice. The caregiver then going on to the virtual gateway to register the same way as a patient would.</li></ul>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21756,'167','1','1250','1820','<p>You can restart this chatbot by pressing the "restart" icon in the footer of the chatbox</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21757,'167','3','650','1740','<p>You can register online or by mail</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21758,'167','5','10','10','Online registration',null,'21762','21757',null,not('1'),null,'2019-05-10 13:29:24','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21759,'167','5','10','10','Register by mail',null,'21763','21757',null,not('1'),null,'2019-05-10 13:29:24','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21760,'167','5','10','10','If using a fee waiver',null,'21764','21757',null,not('1'),null,'2019-05-10 13:29:24','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21761,'167','5','10','10','Any other questions',null,'21765','21757',null,not('1'),null,'2019-05-10 13:29:24','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21762,'167','1','980','1900','<p>Registration is normally done online now, the doctor will give you all the information in the office during your visit as to how to register online.&nbsp;</p><ul><li><a href="https://sso.hhs.state.ma.us/VGPortal/faces/SelfReg.jspx">https://sso.hhs.state.ma.us/VGPortal/faces/SelfReg.jspx</a></li></ul>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21763,'167','1','990','1950','<p>You can register with paper forms if you prefer</p><ul><li>For paper registration you need to make sure you write down the PIN number (provided at the time of the appointment) at the top in that section on the paperwork. You would also want to make sure you take a copy of your ID and a passport photo. (not the passport, just the photo which can be purchased at Walmart for approximately $6) Fill out the paperwork and send in with money order or check.</li></ul>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21764,'167','1','980','2000','<p>There will be a section asking if you are going to use a fee waiver.&nbsp;</p><p>You would check that off and send the registration paper work in.&nbsp;</p><p>The state will send you more paperwork and that when you will send the paperwork from SSI (not social security) SNAP, or MassHealth award letter or redetermination letter.&nbsp;</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21765,'167','1','970','2070','<p>Regarding registration feel free to call DPH at 617-660-5370 or email at medicalmarijuana@state.ma.us</p><p>&nbsp;</p><p>You can restart this chatbot by clicking the "restart" icon in the footer of the chatbox.</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21766,'167','1','630','1850','<p>Any person meeting the requirements under this law shall not be penalized under Massachusetts law in any manner, or denied any right or privilege, for such actions.&nbsp;</p><p>However, being in the program and having a medical marijuana card risks losing your guns&nbsp;<strong>under federal law.&nbsp;</strong>The good news is that Massachusetts will not share your registration with anyone, including federal agencies. Under Massachusetts MMP regulations, only local/state law enforcement can have an access key to the registration database.&nbsp;</p><p>Furthermore, this access is limited to specific inquiries, such as someones status under the program.</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21767,'167','3','300','2170','<p>Are you a new patient or renewing your card?</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21768,'167','5','10','10','New patient',null,'21773','21767',null,not('1'),null,'2019-05-10 13:29:24','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21769,'167','5','10','10','I am renewing my card',null,'21775','21767',null,not('1'),null,'2019-05-10 13:29:24','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21770,'167','5','10','10','Addition info for RI patients',null,'21774','21767',null,not('1'),null,'2019-05-10 13:29:24','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21771,'167','5','10','10','Adding a caregiver',null,'21776','21767',null,not('1'),null,'2019-05-10 13:29:24','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21772,'167','5','10','10','Register with RI State',null,'21777','21767',null,not('1'),null,'2019-05-10 13:29:24','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21773,'167','1','650','2260','<p>New patients will need to bring with themselves a <strong>valid state ID</strong> or drivers license and <strong>$200 for doctor certification</strong>, and <strong>$50 to register with state</strong> ($25 if patient has Medicaid, SSI, SSDI, veterans disability)</p><p>Required 6 month follow up at no charge.</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21774,'167','1','640','2460','<p>Rhode Island patients once registered with the state will have the same expiration date with their MM card registration.&nbsp;</p><p>Patients should stay as close to that day as possible.&nbsp;</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21775,'167','1','630','2350','<p>If renewing you must wait until you receive the renewal paperwork from the State before we can see you.&nbsp;</p><p>If you did not receive the State paperwork make sure that you have not changed your registered address from what you have submitted to the state last time.&nbsp;</p><p>If you did move you have to call the state and notify them of address change and have the state resend you the renewal paperwork.</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21776,'167','1','650','2530','<p>If you as a patient want to add a caregiver, we have the paperwork you need.&nbsp;</p><p>You have to fill it out yourself. Remember that here is also a $100 fee for adding a caregiver that needs to be sent in with caregiver application.</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21777,'167','1','650','2600','<p>When you leave the office you will have 30 days to send in your RI registration packet to:&nbsp;</p><p><strong>Rhode Island Center for Professional Licensing, Room 105A, Capitol Hill</strong></p><p><strong>Providence, RI 02908</strong></p><p>^ Please make sure you have attached your check or money order payable to Rhode Island General Treasurer.</p><p>t is strongly advised you make a copy of your application before submitting it to the state.&nbsp;</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21778,'167','1','340','1390','<p>New patients will require to bring with themselves a valid State ID or drivers license.&nbsp;</p><p>Costs:&nbsp;</p><ul><li>$150 New patients / $140 Renewal / $99 Telemedicine</li><li>Veterans are charged $140</li><li>Medical records are helpful, but not required unless diagnosis is PTSD then it is required!</li><li>IN Maine State there is no state registration fee. No state fee. Patients receive their card on the day of their visit.</li></ul>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21779,'167','3','340','1450','<p>New patients are required to bring with themselves their &nbsp;State ID or drivers license (No Passport).</p><ul><li>$200 Doctor Certification / $100 State Registration</li><li>Medical records required by the state. This can include a letter from specialist or primary care stating patient is being treated for qualifying condition.</li></ul>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21780,'167','5','10','10','Renewing patients',null,'21783','21779',null,not('1'),null,'2019-05-10 13:29:24','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21781,'167','5','10','10','State registration',null,'21784','21779',null,not('1'),null,'2019-05-10 13:29:24','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21782,'167','5','10','10','Caregivers',null,'21785','21779',null,not('1'),null,'2019-05-10 13:29:24','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21783,'167','1','710','1280','<p>Renewing patients do NOT get a new card. You will get an email that you need to keep with you with the card.</p><p>* Renewing patients cannot come in too early to renew. Best is to come about 21-30 days before their card expires.</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21784,'167','1','710','1340','<p>Registration can be done either at your chosen dispensary, or&nbsp;at home from a phone or computer.&nbsp;Once your application is submitted to the state, you will receive an email with a link inviting you to&nbsp;<strong>create an account on Biznet</strong>. From here you can submit a photo of yourselves, scan your state ID and proof of residency, and pay the $100 to the state. You can opt to pay it at that time with a credit or debit card, or mail&nbsp;a check or money order. If you send a check or money order, your registration will not begin processing until the state receives it. Most patients decide to go to the dispensary and have the staff there take care of this for them.&nbsp;</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21785,'167','1','710','1400','<p>Patients can come into the office with the caregiver. The office will need the name and DOB of the patient. At the time they will put the caregivers information with the patients. They will finish the process at the dispensary where they will also be able to make the payment to become the caregiver.</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21786,'167','3','340','1510','<p>New patients will need to show a valid state ID or drivers license.</p><p>(If address does not match ID, 2 proofs of address are required to register with the MMCC)</p><p>Costs:</p><ul><li>$200 for doctor certification.&nbsp;$50 state registration fee. Starting April 1st, 2018 patients no longer have the option to use their MD state ID or drivers license as their medical ID card, they are required to get an actual medical card from the state. State registration cards are valid for 3 years.</li></ul>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
