INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21789,'167','5','10','10','Existing patients',null,'21792','21786',null,not('1'),null,'2019-05-10 13:29:24','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21790,'167','1','630','1910','<p>When patients register with the MMCC you will need to have a credit card with $50 on it to pay the state.</p><p>MMCC cards are valid for 3 years. New doctor certifications are required yearly.</p><ul><li>Patients are encouraged to register with the MMCC to get their MMCC ID number before booking their appointment. Any patients needing help may come into the office for assistance registering. If you will register yourself, we can schedule an appointment a few weeks out so that you may have received your number by then.</li><li>If you do not have your MMCC ID # we can still see you, but we can not certify you until you forward the email you receive from the MMCC containing your patient ID #. You MUST wait until the physician you saw is in the office again for your certification to be issued.</li></ul>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21791,'167','1','630','1970','<p>If you are seeing the same provider as last year we can revoke your certification in order to recertify prior to the expiration. If it is a different provider; your certification must expire &amp; then we will recertify the next day the provider is in the office.</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21792,'167','1','640','2030','<ul><li>Existing patients are required to purchase a card for entrance into a dispensary.</li><li>State registration fee is $50 for the purchase of the card.</li></ul>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21793,'167','3','350','1570','<p>All DC physicians\' recommendations are $200.</p><ul><li>Only DC residents are eligible for certification at this time as out of state cannabis reciprocity has not been instated yet.</li><li>DC does NOT require medical records</li></ul>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:24','2019-05-10 13:29:24') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21794,'167','5','10','10','Mandatory for DC patients',null,'21796','21793',null,not('1'),null,'2019-05-10 13:29:24','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21795,'167','5','10','10','Reduced State fee requirements',null,'21797','21793',null,not('1'),null,'2019-05-10 13:29:24','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21796,'167','1','710','1470','<p>Patients will have to complete a DC Department of Health application that includes:</p><ul><li>2 Proofs of DC residency</li><li>Photo ID</li><li>Application fee of $100 payable to: DC Treasurer</li></ul>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:25','2019-05-10 13:29:25') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21797,'167','1','710','1530','<p>DC does offer a reduced fee of $25 with proof of the following:</p><ul><li>Medicaid or DC Alliance - current</li><li>Documentation verifying total gross income is equal too or less than 200% of the federal poverty level including:</li><li>Child support &amp; Alimony received</li><li>Rent payments received</li><li>Any income received on a regular basis</li></ul>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:25','2019-05-10 13:29:25') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21798,'167','3','350','1620','<p>New patients will need to bring with themselves a valid state ID or drivers license.</p><ul><li>$200 for doctor certification, $125 for state registration</li><li>Patients will also need to bring&nbsp;3-6 months of medical documentation</li><li>If patient has neurological condition they can be seen by Dr. Warson with minimal medical records.</li></ul>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:25','2019-05-10 13:29:25') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21799,'167','5','10','10','State registration info',null,'21800','21798',null,not('1'),null,'2019-05-10 13:29:25','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21800,'167','1','630','1690','<p>Address to mail in state registration:</p><p>Delaware Health and Social Services</p><p>Division of Public Health Medical Marijuana Program</p><p>417 Federal Street</p><p>Jesse Cooper Building, Suite 130</p><p>Dover, Delaware 19901</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:25','2019-05-10 13:29:25') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21801,'167','3','330','1670','<ol><li>There is a $200 fee for doctor certification.</li><li>Be sure to obtain medical records or documentation from your primary care physician describing the diagnosis.</li><li>Return to the patient and caregivers registry and pay for the medical marijuana ID card. There is a $50 fee and it will take approximately 3 weeks to receive your card.&nbsp;</li><li>Receive your card in the mail. Visit the dispensary beginning the day your card is active.</li></ol>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:25','2019-05-10 13:29:25') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21802,'167','5','10','10','Register with the PA Department of Health',null,'21803','21801',null,not('1'),null,'2019-05-10 13:29:25','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21803,'167','1','640','1800','<p>Register with the Pennsylvania Department of Health through the Patient and Caregiver Registry at <a href="https://medicalmarijuana.pa.gov">medicalmarijuana.pa.gov</a> <strong>before coming to see the doctor</strong>.</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:25','2019-05-10 13:29:25') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21804,'167','3','340','1730','<p>There is a $200 fee for the doctor certification.</p><p>Patients have the option to choose how long they want their registration with the state:</p><ul><li>1 year - $100</li><li>2 year - $200</li><li>3 year - $250</li></ul><p>If patient is a veteran, or receives SSI or SSDI then the state applications fees are reduced by 50%.</p><p>Patients need to bring the following with them:</p><ul><li>DL or State ID</li><li>Recent Medical Records (must show actual diagnosis)</li><li>DD214 (the State wants this as proof for reduction in application fees)</li><li>Vet ID (for our CCD records)</li><li>1 proof of residency (the DL or ID is not enough)</li></ul>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:25','2019-05-10 13:29:25') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21805,'167','5','10','10','IL ID card registration requirements',null,'21808','21804',null,not('1'),null,'2019-05-10 13:29:25','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21806,'167','5','10','10','Physician Written Certification',null,'21809','21804',null,not('1'),null,'2019-05-10 13:29:25','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21807,'167','5','10','10','Veterans',null,'21810','21804',null,not('1'),null,'2019-05-10 13:29:25','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21808,'167','1','620','2090','<ul><li>Be a resident of the state of IL at the time of application and remain a resident during participation in the program.</li><li>Have a qualifying debilitating condition.</li><li>Have a signed physician certification (unless you are a veteran receiving care at a VA facility)&nbsp;</li><li>Fingerprinting as well as background check are no longer required.</li><li>Be at least 18 years of age.&nbsp;</li><li>Not hold a school bus permit or commercial drivers license.&nbsp;</li><li>Not be an active duty law enforcement officer, correctional officer, correctional probation officer or firefighter.&nbsp;</li></ul>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:25','2019-05-10 13:29:25') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21809,'167','1','630','2160','<p>Make sure your physician completes the Physician Written Certification and gives the form back to you for submission with your application. You must scan the form and save it as a .PDF document to upload it with your online application or include the original document with your paper application. The certification bust be received within 90 days of your application and must show an in-person visit date within the last 90 days.&nbsp;</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:25','2019-05-10 13:29:25') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21810,'167','1','940','2400','<p>Veterans who receive health services at a VA facility are not required to obtain a physicians written certification but must submit 12 months of VA records to the Department with their application.</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:25','2019-05-10 13:29:25') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21811,'167','1','340','1780','<p>New patients in Ohio will need to bring with themselves a valid state ID or Drivers license.</p><ul><li>$50 state registration fee</li><li>Note that Medical records required.</li></ul>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:25','2019-05-10 13:29:25') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21812,'167','3','330','1840','<p>New York patients can be seen in the Pittsfield location in Massachusetts on Wednesdays with Dr. Bernhard.</p><ul><li>Need state ID or Driver\'s license</li><li>$200 doctor certification fee</li><li>NY is currently waiving state registration fees for patients. You just need to click the "bill me later" option when registering.</li><li>Medical documentation showing diagnosis of qualifying condition required..</li></ul>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:25','2019-05-10 13:29:25') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21813,'167','5','10','10','Telemedicine',null,'21815','21812',null,not('1'),null,'2019-05-10 13:29:25','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21814,'167','5','10','10','Caregivers',null,'21816','21812',null,not('1'),null,'2019-05-10 13:29:25','2019-05-10 13:29:26') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21815,'167','1','940','2130','<p>New York patients can use telemedicine. Note you will need to fax over a printout copy of your drivers license or state ID &amp; also your medical documentation. You will need to do this before you can do a telemedicine appointment.</p><ul><li>$99 fee for doctor certification</li></ul>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:25','2019-05-10 13:29:25') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21816,'167','1','930','2190','<p>Patients are allowed to have up to 2 caregivers.&nbsp;</p><p>Caregivers are not allowed to have more than 5 certified patients.</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:25','2019-05-10 13:29:25') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21817,'167','1','330','1910','<p><strong>New patient with NO records - $260</strong></p><ul><li>$50 - pain exam (for records)</li><li>$50 - doctor certification</li><li>$150 ($75 if pt has snap) - state fee</li><li>$10 - upload fee</li></ul><p><strong>New&nbsp;patients&nbsp;WITH records or renewal - $210</strong></p><ul><li>$50 - doctor certification</li><li>$150 ($75 if pt has snap) - state fee</li><li>$10 - upload fee</li></ul>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:25','2019-05-10 13:29:25') ;
