INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21832,'167','1','570','2980','<p><strong>Massachusetts Debilitating Medical Conditions</strong></p><ul><li>Aids</li><li>Arthritis</li><li>Cancer</li><li>Back pain</li><li>PTSD</li><li>Fibromyalgia</li><li>Glaucoma</li><li>HIV</li><li>Multiple Sclerosis</li><li>Scholiosis</li><li>ADHD / ADD</li><li>Anxiety</li><li>Cachexia / weight loss</li><li>Depression</li><li>Eating Disorders</li><li>Hepatitis C</li><li>Crohn\'s and other IBD\'s</li><li>Insomnia</li><li>Nausea / Vomiting</li><li>Post Traumatic Pain</li><li>ALS</li><li>Alzheimer\'s</li><li>Migraines</li><li>Movement Disorders</li><li>Parkinson\'s Disease</li><li>Seizures</li><li>Sleep Apnea</li><li>Tourette\'s Syndrome</li></ul>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:25','2019-05-10 13:29:25') ;
