INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21834,'167','1','570','3080','<p><strong>Maine Debilitating Medical Conditions</strong></p><p>Effective Now:&nbsp;</p><p>Any patient can come in with any medical condition,&nbsp;it is now up to the doctor if the condition would qualify the patient for medical marijuana.</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:25','2019-05-10 13:29:25') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21835,'167','1','560','3140','<p><strong>Connecticut Debilitating Medical Conditions</strong></p><ul><li>Cancer</li><li>Glaucoma</li><li>Positive status for HIV or AIDS</li><li>Parkinson\'s&nbsp;Disease</li><li>Multiple Sclerosis</li><li>Damage to the nervous tissue of the spinal cord with objective neurological indication of intractable spasticity.</li><li>Epilepsy</li><li>Cachexia</li><li>Wasting Syndrome</li><li>Crohns Disease</li><li>PTSD</li><li>Sickle Cell Disease</li><li>Post Laminectomy Syndrome with chronic Radiculopathy</li><li>Cerebral Palsy</li><li>Cystic Fibrosis</li><li>Irreversible spinal cord injury with objective neurological indication of intractable spasticity</li><li>Terminal Illness requiring end of life care</li><li>Uncontrolled Intractable Seizure Disorder</li><li>Spasticity or Neuropathic Pain Associated with Fibromyalgia</li><li>Severe Rheumatoid Arthritis</li><li>Post Herpetic Neuralgia</li><li>Hydrocephalus with intractable headaches</li><li>Intractable headache syndrome (Migraines)</li><li>Neuropathic Facial pain</li><li>Chronic Neuropathic pain due to Degenerative Spine Disorder</li><li>Severe Psoriasis and Psoriatic Arthritis&nbsp;</li><li>Amyotrophic Lateral Sclerosis</li><li>Ulcerative Colitis&nbsp;</li><li>Complex Regional Pain Syndrome</li></ul>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:25','2019-05-10 13:29:25') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21836,'167','1','560','3190','<p><strong>Maryland Debilitating Medical Conditions</strong></p><ul><li>Cachexia</li><li>Anorexia</li><li>Wasting syndrome</li><li>Severe chronic pain</li><li>Severe nausea</li><li>Seizures, including those characteristics of epilepsy</li><li>Severe and persistent muscle spasms</li><li>Glaucoma</li><li>PTSD</li><li>Chronic pain</li><li>Multiple sclerosis</li><li>Chron\'s disease</li></ul><p>*Any severe debilitating condition which has not been relieved by other medical treatments, and could reasonably be expected to be relieved by cannabis therapy.</p>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:25','2019-05-10 13:29:25') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21837,'167','1','560','3240','<p><strong>Washington Debilitating Medical Conditions</strong></p><ul><li>HIV/AIDS</li><li>Glaucoma</li><li>Multiple Sclerosis</li><li>Cancer</li><li>or any other condition, as determined by rulemaking that is, chronic or long-lasting;</li><li>or is debilitating or interferes with the basic functions of life; and is a serious medical condition for which the use of medical marijuana is beneficial, that cannot be effectively treated by any ordinary medical or surgical measure,&nbsp;or for which there is scientific evidence that the use of medical marijuana is likely to be significantly less addictive than the ordinary medical treatment for that condition.</li><li>Patients may also qualify by undergoing any of the following medical treatments:<a href="https://www.marijuanadoctors.com/conditions/chemotherapy/">Chemotherapy</a>;&nbsp;<a href="https://www.marijuanadoctors.com/conditions/radiation-therapy/">radiotherapy</a>;&nbsp;the use of azidothymidine or protease inhibitors;&nbsp;or any other treatment as determined by rulemaking, whose side effects require treatment through the administration of medical marijuana in the same manner as a qualifying medical condition.</li></ul>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:25','2019-05-10 13:29:25') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(21838,'167','1','560','3290','<p><strong>Delaware Debilitating Medical Conditions</strong></p><ul><li>Terminal Illness</li><li>Cancer</li><li>HIV / AIDS</li><li>Decompensated cirrhosis</li><li>Glaucoma</li><li>Hepatitis C</li><li>Lou Gehrig\'s disease (ALS)</li><li>Alzheimer\'s disease</li><li>PTSD</li><li>Intractable epilepsy</li><li>Migraines</li><li>Autism with self-injurious or aggressive behavior</li><li>A Chronic or debilitating pain that has not responded to prescribed medication within 3 months</li><li>Cachexia (wasting syndrome)</li><li>Intractable Nausea</li><li>Seizures</li><li>Severe or persistent muscle spasms, including those characteristics of multiple sclerosis</li></ul><p><strong>Non-Neurological Conditions</strong></p><ul><li>Alzheimer\'s</li><li>ALS<br></li><li>Backpain</li><li>Brain Tumor</li><li>Spinal or Nerve Tumor</li><li>Carpal Tunnel Syndrome</li><li>Neck Pain</li><li>Spinal Stenosis&nbsp;</li><li>Radiculopathy</li><li>Spondylosis</li><li>Chronic headaches, migraines</li><li>Complex regional pain syndrome</li><li>Degenerative disc disease</li><li>Diabetic Neuropathy</li><li>Epilepsy</li><li>Tremors</li><li>Herniated Disc</li><li>Multiple Sclerosis</li><li>Muscle Spasm</li><li>Neuropathic pain of any origin</li><li>Parkinson\'s disease</li><li>Peripheral nerve injuries</li><li>Restless leg syndrome</li><li>Sciatica</li><li>Seizures</li><li>Spasticity&nbsp;</li><li>Trigeminal Neuralgia</li></ul>',null,null,null,'[]',not('0'),null,'2019-05-10 13:29:25','2019-05-10 13:29:25') ;
