INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(22090,'171','1','660','550','<p>Qualifying conditions for medical marijuana treatment in the state of Maine.</p><p>&nbsp;</p><ul><li>Chronic pain that has not responded to traditional treatments for 6 months or more.</li><li>Intractable pain, or a chronic or debilitating disease or medical condition or its treatment that produces cachexia, severe nausea, or seizures</li><li>PTSD</li><li>Severe and persistent muscle spasms (such as those characteristic of multiple sclerosis)</li><li>Seizure Disorders</li><li>Cancer</li><li>Glaucoma</li><li>Positive status for human immunodeficiency virus (HIV)</li><li>Hepatitis C</li><li>ALS (Amyotrophic Lateral Sclerosis)</li><li>Crohns disease</li><li>Inflammatory Bowel Disease</li><li>Agitation of Alzheimers disease</li><li>Nail-patella syndrome</li></ul>',null,'22092',null,'[]',not('0'),null,'2019-05-10 13:43:37','2019-05-10 13:43:37') ;
