INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(936277,'545','4','840','460','<p>Ok. The prime feature of Promptchat is its <strong>Broadcasting</strong> feature.</p><p>You can use Promptchat to send sales/marketing campaigns via various messaging channels. The most widely used channel for sales campaigns is SMS, &nbsp;WhatsApp and FB Messenger.</p><p>Simply upload your SMS and/or WhatsApp/Facebook contacts and send marketing messages in a bulk or one by one.&nbsp;</p>','Ok','936269',null,'[]',not('1'),'[]','2020-06-01 16:55:45','2020-06-01 16:55:45') ;
