INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(936337,'550','3','340','1000','<p>Ok, do you want to learn how a simple sales chatbot can help your business register customer interest and even take purchase orders unattended 24/7?&nbsp;</p><p>Such chatbot can be set up very quickly and can be used cross platform on any Promptchat supported chat delivery channel. Ie: once you create a chatbot you can post it to an SMS number, WhatsApp or FB Messenger channel simultaneously.</p>',null,null,null,'[]',not('1'),'[]','2020-06-01 16:56:09','2020-06-01 16:56:09') ;
