INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1304962,'711','4','20','1000','<p><strong>Medical centers</strong> around the world rely on chatbots for booking patient appointments based on each surgery\'s booking calendar availability. If the chatbot is installed on the surgery\'s website, it will also allow patients to book appointments with the nearest qualified surgery based on the patients\' real time geographical location. (Google Maps integration). Patients can be pre screened by going through a set of qualifying questions including the use of document upload/download features. Once appointments are successfully booked, Email and SMS confirmation goes to both the patient as well as the surgery. Such appointment booking chatbots can be deployed to work via SMS too, being the most widely used messaging channel.</p>','SurgeryBOT_read','1304964',null,'[]',not('1'),'[]','2020-07-22 14:51:21','2020-07-22 14:51:21') ;
