INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1586970,'920','4','20','1000','<p><strong>Medical centers</strong> around the world rely on chatbots for booking patient appointments based on each surgery\'s booking calendar availability. If the chatbot is installed on the surgery\'s website, it will also allow patients to book appointments with the nearest qualified surgery based on the patients\' real time geographical location. (Google Maps integration). Patients can be pre screened by going through a set of qualifying questions including the use of document upload/download features. Once appointments are successfully booked, Email and SMS confirmation goes to both the patient as well as the surgery. Such appointment booking chatbots can be deployed to work via SMS too, being the most widely used messaging channel.</p>','SurgeryBOT_read','1586972',null,'[]',not('1'),'[]','2020-10-19 22:01:07','2020-10-19 22:01:07') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1586971,'920','5','10','10','Show me another example',null,null,'1586970',null,not('1'),null,'2020-10-19 22:01:07','2020-10-19 22:01:07') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1586972,'920','4','20','1820','<p>Probably the most common chatbots for sales/marketing purposes are used for "new product announcements" or "happy hour discount vouchers" sent out via WhatsApp and FB Messenger. Such chatbots deliver short and effective sales messages to a targeted group of registered clients who can place orders on periodically broadcasted incentives. Such as, "repeat order at half price". Existing contacts are tagged based on their location &amp; their unique interest and these tags help marketers send their messaged to a precise, targeted audience.</p>','UpsellingBOT_read','1586974',null,'[]',not('1'),'[]','2020-10-19 22:01:07','2020-10-19 22:01:07') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1586973,'920','5','10','10','Ok, show me another example',null,null,'1586972',null,not('1'),null,'2020-10-19 22:01:07','2020-10-19 22:01:07') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1586974,'920','4','460','1820','<p>Chatbots are all about automation. For example; <strong>Real estate agents</strong> receive new leads via email from the portal website(s) they advertise their listings on. Such emails include the name and phone number of the person interested in a particular property. A chatbot will <strong>automatically</strong> scan these incoming emails and send a pre scripted SMS message to the inquirer inviting him/her to connect to the real estate agent via WhatsApp (link sent via SMS). During this automatic process the inquirer is automatically tagged with Sales/Letting/Location tags ready for future marketing messaging via WhatsApp and SMS.</p>','PropertyBOT_read','1586976',null,'[]',not('1'),'[]','2020-10-19 22:01:07','2020-10-19 22:01:07') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1586975,'920','5','10','10','Ok, show me one more example',null,null,'1586974',null,not('1'),null,'2020-10-19 22:01:07','2020-10-19 22:01:07') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1586976,'920','4','830','1820','<p>Recruitment agencies receive 100s of new applications from their websites every day. A recruitment chatbot will pre screen applicants during the online application process and ensure that the recruiting agents spend their time with the most qualified applicants first. Depending on the outcome of the pre screening process, successful applicants are offered a phone interview directly with the managing recruiter based on their calendar availability. Applicants are tagged with their education, experience and location - ready for future messaging via WhatsApp or any other chat channel.</p>','RecruitmentBOT_read','1586978',null,'[]',not('1'),'[]','2020-10-19 22:01:07','2020-10-19 22:01:07') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1586977,'920','5','10','10','Ok, tell me about chatbots for support automation',null,null,'1586976',null,not('1'),null,'2020-10-19 22:01:07','2020-10-19 22:01:07') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1586978,'920','4','1260','1820','<p>Be there for your customer 24/7, on their preferred channels. You can build custom chatbots with live chat and API integrations using the easy to use drag &amp; drop chatbot builder platform or have one of our trained professionals build you one. How do you support your customers today? (tick all that apply)</p>','Existing_support','1586986',null,'[]',not('1'),'[]','2020-10-19 22:01:07','2020-10-19 22:01:07') ;
