INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1637688,'923','1','800','230','<p>? Certo... Você já conhece todos os produtos e serviços da *Lambda Tecnologia*?</p><p>Vou te apresentar:</p><p>? LambdaNET ? É nosso produto de acesso à internet em Parnamirim e Nísia Floresta/RN, utilizando o que há de mais moderno em tecnologia rádio, pois sabemos da importância de qualidade e estabilidade em nossas conexões de internet!</p>',null,'1637698',null,'[]',not('0'),'[]','2020-11-13 16:48:00','2020-11-13 16:48:00') ;
