INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1637693,'923','1','1750','170','<p>?Certo, primeiro, vou te mostrar a tabela de preços:</p><p>&nbsp;</p><p>"*LambdaNet - Internet banda larga na Colônia, Hortigranjeira, Lago Azul, Pium e Cotovelo*</p><p>&nbsp;</p><p>*Nossos Planos:*</p><p>02Mbps &nbsp;? 59,90</p><p>04Mbps &nbsp;? 79,90</p><p>06Mbps &nbsp;?99,90</p><p>08Mbps &nbsp;?119,90</p><p>12Mbps &nbsp;?149,90</p><p>&nbsp;</p><p>Forma de pagamento:</p><p>? Carnê &nbsp;</p><p>&nbsp;</p><p>*Taxa de ativação:*</p><p>&nbsp;</p><p>? Antena ? 150,00</p><p>? Roteador Wi-Fi? 150,00</p><p>&nbsp;</p><p>*ATENÇÃO:*</p><p>&nbsp;</p><p>*Não vendemos nenhum equipamento, todos são entregues em regime de comodato e serão recolhidos na finalização do contrato*</p><p>&nbsp;</p><p>*Se for instalada somente a antena será disponibilizada a internet para apenas um equipamento via cabo*</p><p>&nbsp;</p><p>*Forma de pagamento:* &nbsp;</p><p>?2x no boleto *(50% a vista no dia da instalação e 50% para primeira parcela de internet)* ou &nbsp;</p><p>? 3x no cartão de crédito</p><p>&nbsp;</p><p>&nbsp;</p><p>* Suporte garantido?????????</p><p>** Sem fidelidade contratual??????</p><p>*** Equipamentos de alta tecnologia??????</p><p>&nbsp;</p><p>*Tabela de preços válida a partir de 17/08/2020</p>',null,'1637700',null,'[]',not('0'),'[]','2020-11-13 16:48:00','2020-11-13 16:48:00') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1637694,'923','1','750','90','<p>? *LambdaBOT* ? É o nosso departamento de CHATBOT, onde desenvolvemos robôs de conversação para que realizem atendimento e vendas de todos os tipos para o seu negócio! Se quiser saber mais sobre esse serviço, converse comigo diretamente na opção *QUEM É VOCÊ*.</p>',null,'1637699',null,'[]',not('0'),'[]','2020-11-13 16:48:00','2020-11-13 16:48:00') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1637695,'923','1','1090','10','<p>? *LambdaLAB* ? É o nosso laboratório de automação e IoT, desenvolvemos projetos de automação residencial ou corporativa de acordo com a sua necessidade e gastando muito menos que se pode imaginar. Para ter um atendimento diferenciado para este serviço, por favor nos envie um e-mail para contato@lambda.tec.br que o nosso comercial entra em contato. &nbsp;</p>',null,'1637696',null,'[]',not('0'),'[]','2020-11-13 16:48:00','2020-11-13 16:48:00') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1637696,'923','1','1400','10','<p>? *LambdaCLOUD* ? Gerenciamos e transferimos toda a sua infraestrutura de TI para uma *cloud*, reduzindo seus custos de manutenção, operação e aquisição de equipamentos. Para ter um atendimento diferenciado para este serviço, por favor nos envie um e-mail para contato@lambda.tec.br que te retornamos.</p>',null,'1637689',null,'[]',not('0'),'[]','2020-11-13 16:48:00','2020-11-13 16:48:00') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1637697,'923','1','600','1120','<p>??? ATENDENTE ??? &nbsp;</p><p>&nbsp;</p><p>? Certo... Vou transferir para um atendente humano. Eles estão disponíveis nos dias úteis das 09 às 18 horas.&nbsp;<br><br>Você também pode conseguir atendimento 24 horas por dia da seguinte forma:</p><p>? *(84) 3190 0990*<br>? <a href="https://bit.ly/sac-lambda">https://bit.ly/sac-lambda</a></p>',null,'1637734',null,'[]',not('0'),'[]','2020-11-13 16:48:00','2020-11-13 16:48:00') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1637698,'923','1','750','10','<p>? *LambdaCAM* ? Segurança eletrônica em Parnamirim e Nísia Floresta é com a gente. &nbsp;Temos uma plataforma de monitoramento, onde cuidamos da segurança sua casa, seu comércio ou sua vizinhança pagando uma mensalidade que cabe no seu bolso!</p>',null,'1637694',null,'[]',not('0'),'[]','2020-11-13 16:48:00','2020-11-13 16:48:00') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1637699,'923','1','1080','150','<p>? *LambdaSOFT* ? Desenvolvemos softwares, de acordo com a sua necessidade, dentro de um prazo e custo compatível com o tamanho da sua empresa, melhorando a sua gestão e trazendo mais lucros! &nbsp;Para ter um atendimento diferenciado para este serviço, por favor nos envie um e-mail para contato@lambda.tec.br que que o nosso comercial entra em contato.</p>',null,'1637695',null,'[]',not('0'),'[]','2020-11-13 16:48:00','2020-11-13 16:48:00') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1637700,'923','1','1730','10','<p>Para contratar pode ser de suas formas:</p><p>1) Pode preencher o cadastro no link https://bit.ly/assine-lambda, que o nosso sistema já recebe suas informações e o comercial te retorna para tirar as últimas dúvidas e agendar sua instalação;</p><p>2) Baixe o nosso aplicativo <i>Lambda Tecnologia na Play Store ou acesse pelo link https://bit.ly/app-lambda e selecione a opção *</i>Contratar*</p><p>&nbsp;</p>',null,'1637701',null,'[]',not('0'),'[]','2020-11-13 16:48:00','2020-11-13 16:48:00') ;
