INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1637705,'923','3','110','460','<p>??? &nbsp;*SUPORTE* ???</p><p>&nbsp;</p><p>? Certo, primeiro preciso saber se você já tem chamado aberto! ?</p>',null,null,null,'[]',not('0'),'[]','2020-11-13 16:48:00','2020-11-13 16:48:00') ;
