INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1637708,'923','1','60','250','<p>"? *ACOMPANHAR CHAMADO* ?</p><p>Para acompanhar seu chamado aberto, por favor acesse sua Central do Assinante, por meio do link https://bit.ly/central-lambda, ou no seu APP da Lambda Tecnologia (https://bit.ly/app-lambda), opção ""Central do Assinante""."</p><p>&nbsp;</p><p>Na Central do Assinante, escolha a opção *Visualizar Chamados*</p><p>&nbsp;</p><p>*Verifique as mensagens e interaja com a nossa equipe de atendimento no botão "Ver Respostas" do seu chamado!*</p><p>&nbsp;</p><p>Seu chamado tem o prazo de até 03 dias úteis para ser respondido pela nossa equipe e você receberá uma mensagem minha quando tiver uma nova resposta ou nossa equipe fechar o seu chamado.</p><p>&nbsp;</p><p>? Fique atento ao dia e hora prevista de atendimento do seu chamado, pois o técnico só poderá atender o chamado caso tenha alguma pessoa indicada pelo cliente no local. ?</p>',null,'1637701',null,'[]',not('0'),'[]','2020-11-13 16:48:00','2020-11-13 16:48:00') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1637709,'923','3','120','630','<p>?*TENHO UM PROBLEMA*?</p><p>Certo, vou te ajudar a fazer uma verificação bem rápida para que você tente resolver sozinho, se não der certo a gente abre um chamado, para te ajudar melhor ainda, preciso apenas saber qual o produto da empresa?</p>',null,null,null,'[]',not('0'),'[]','2020-11-13 16:48:00','2020-11-13 16:48:00') ;
