INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1637713,'923','1','110','780','<p>? Certo, seu problema é com internet, primeiramente, vou tentar te ajudar</p><p>&nbsp;</p><p>Vamos realizar os seguintes passos, pois isso resolve 99% dos problemas, pois estaremos conferindo e reiniciando a sua conexão, pois na maioria das vezes, uma bobagem como um cabo com mal contato deixa a gente sem serviço:</p><p>&nbsp;</p><p>1) Verifique se aparece a sua rede WiFi de costume e seu aparelho está conectado corretamente ao WiFi;</p><p>2) Verifique se os cabos estão bem presos à fonte e ao roteador e se os conectores estão limpos e tudo está ligado à energia elétrica;</p><p>3) Verifique se o cabo que vem da antena está ligado na porta PoE da fonte;</p><p>4) Verifique se o cabo que sai da fonte pela porta LAN está na porta WAN do roteador;</p><p>5) Retire tudo da tomada, aguarde 05 minutos e coloque novamente;</p>',null,'1637714',null,'[]',not('0'),'[]','2020-11-13 16:48:00','2020-11-13 16:48:00') ;
