INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1637718,'923','1','660','790','<p>? Certo! Que pena que não resolvemos, neste caso vou te ajudar a abrir um chamado para você</p><p>&nbsp;</p><p>Infelizmente ainda não consigo abrir protocolo por esse canal.</p><p>&nbsp;</p><p>1) Para acessar a Central Assinante clique no link http://bit.ly/central-lambda&nbsp;</p><p>2) Para abertura de qualquer chamado (MANUTENÇÃO, FINANCEIRO E/OU OUTROS ASSUNTOS), clicar opção Visualizar Chamados</p><p>3) Preencher o campo "Motivo da Solicitação" escrevendo o seu problema ou sua mensagem com sua solicitação, dando o máximo de detalhamento possível &nbsp;</p><p>4) Pronto! Nossa equipe te atenderá no prazo máximo de 03 dias úteis.</p>',null,'1637701',null,'[]',not('0'),'[]','2020-11-13 16:48:00','2020-11-13 16:48:00') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1637719,'923','3','230','1280','<p>?*CANCELAMENTO*?</p><p>?Que pena! O que aconteceu??</p><p>&nbsp;</p><p>Você chegou a abrir algum chamado sobre o seu problema? Foi resolvido? Posso encaminhar um técnico para ver o que está acontecendo, porém para isso precisamos de um chamado aberto pelo sistema.</p><p>&nbsp;</p><p>Você quer mesmo realizar o cancelamento ou deseja abrir um chamado para vermos como podemos resolver o que está acontecendo?</p>',null,null,null,'[]',not('0'),'[]','2020-11-13 16:48:00','2020-11-13 16:48:00') ;
