INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1637722,'923','1','40','1180','<p>? Certo! Que pena que você quer cancelar, neste caso vou te ajudar a abrir um chamado para você e um atendente da *Lambda Tecnologia* vai poder realizar todo o seu processo de cancelamento</p><p>&nbsp;</p><p>Infelizmente ainda não consigo abrir protocolo por esse canal.</p><p>&nbsp;</p><p>1) Para acessar a Central Assinante clique no link https://bit.ly/central-lambda</p><p>2) Para abertura de qualquer chamado, clicar opção Visualizar Chamados</p><p>3) Preencher o campo "Motivo da Solicitação" escrevendo o solicitando o cancelamento e, se quiser, pode nos contar o motivo do cancelamento para que possamos buscar melhorar nossos processos</p><p>4) Pronto! Nossa equipe te atenderá no prazo máximo de 03 dias úteis e seu cancelamento contará a partir da data da abertura da solicitação.</p>',null,'1637701',null,'[]',not('0'),'[]','2020-11-13 16:48:00','2020-11-13 16:48:00') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1637723,'923','1','270','1420','<p>? *QUEM É VOCÊ?* ?</p><p>&nbsp;</p><p>&nbsp;</p><p>Eu sou o Zé, o atendente robótico, dotado de inteligência artificial, que objetiva atender os clientes de qualquer empresa 24 horas por dia nos mais diversos canais de atendimento, como:</p><p>&nbsp;</p><p>? Site</p><p>? Facebook,</p><p>? Whatsapp</p><p>? Direct (Instagram)</p><p>? Telegram</p><p>&nbsp;</p><p>Posso também me integrar aos sistemas de atendimento da sua empresa e realizar algumas ações como</p><p>&nbsp;</p><p>? Cadastro e encaminhamento de vendas</p><p>? Agendamento de visitas e consultas</p><p>? Atendimento ao cliente (SAC)</p><p>? Direcionamento para outro canal de venda</p><p>? Responder às questões mais comuns dos clientes (FAQ)</p><p>&nbsp;</p><p>Para saber mais e ter um orçamento personalizado, mande um e-mail para *contato@lambdati.com.br*</p>',null,'1637701',null,'[]',not('0'),'[]','2020-11-13 16:48:00','2020-11-13 16:48:00') ;
