INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1637729,'923','1','2070','880','<p>? Certo! Vou te ajudar a visualizar seus boletos e recibos de pagamento! &nbsp;</p><p>&nbsp;</p><p>Infelizmente ainda não consigo abrir protocolo por esse canal.</p><p>&nbsp;</p><p>1) Para acessar a Central Assinante clique no link https://bit.ly/central-lambda</p><p>2) Acessar a opção *"Histórico de Pagamentos"*;</p><p>3) Para visualizar a fatura que deseja é só clicar em cima dela que o sistema abre o boleto;</p><p>4) Pronto! Sua fatura já está em mãos.... Você também pode verificar os seus recibos de pagamento na tela de histórico de pagamentos;</p><p>&nbsp;</p>',null,'1637701',null,'[]',not('0'),'[]','2020-11-13 16:48:00','2020-11-13 16:48:00') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1637730,'923','1','2080','970','<p>? Certo! Vou te ajudar a a notificar o pagamento! &nbsp;</p><p>&nbsp;</p><p>Se eu te fiz alguma cobrança, te peço desculpas, é porque às vezes o banco pode levar até 03 dias para informar o pagamento...</p><p>&nbsp;</p><p>Infelizmente ainda não consigo abrir protocolo por esse canal.</p><p>&nbsp;</p><p>1) Para acessar a Central Assinante clique no link https://bit.ly/central-lambda &nbsp;</p><p>2) Na opção *"Histórico de Pagamentos"* você consegue visualizar os pagamentos realizados e a vencer; &nbsp;</p><p>3) Clique no botão *"Notificar Pagamento"* para que sua internet será liberada caso tenha algum bloqueio por atraso;</p><p>&nbsp;</p><p>*ATENÇÃO: Caso tenha realizado o pagamento via transferência bancária ou PIX, favor abrir um chamado informando valor e data/hora da operação, para que possamos identificar o seu pagamento manualmente.*</p>',null,'1637701',null,'[]',not('0'),'[]','2020-11-13 16:48:00','2020-11-13 16:48:00') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1637731,'923','1','2080','1060','<p>? Certo, enquanto o sistema não entra em funcionamento, vou te explicar o que são chaves PIX. Você pode utilizar o aplicativo do seu banco para gerar sua chave.</p><p>&nbsp;</p><p>PIX é o novo sistema de transferência de dinheiro criado pelo Banco Central e vai permitir a transferência de dinheiro entre contas em até 10 segundos, bastando acessar o aplicativo do seu banco e informar a CHAVE PIX que vai receber a transferência.</p><p>&nbsp;</p><p>&nbsp;</p><p>1. O QUE SÃO AS CHAVES PIX?</p><p>&nbsp;</p><p>Elas são um apelido para os seus dados bancários. Quando você for receber uma transferência de alguém, só vai precisar informar uma chave Pix em vez de banco, agência, conta, CPF/CNPJ e nome completo.</p><p>&nbsp;</p><p>2. QUANTAS CHAVES PIX EU POSSO TER?</p><p>Pessoas físicas, poderão ter até 5 chaves no total.</p><p>&nbsp;</p><p>3. QUAIS OS TIPOS DE CHAVE PIX?</p><p>Para Pessoa Física Existem 4 tipos:</p><p> Número de celular</p><p> CPF</p><p> E-mail</p><p> Chave aleatória</p><p>&nbsp;</p><p>*Exceto no caso do CPF, você pode ter mais de uma chave de cada tipo. Por exemplo: 2 números de celular diferentes, 2 endereços de e-mail diferentes e 1 CPF, totalizando 5 chaves.*</p><p>&nbsp;</p><p>4. PRECISO CADASTRAR TODAS AS MINHAS CHAVES EM UM SÓ BANCO?</p><p>Não. Você pode cadastrar cada chave em um banco diferente. Também pode cadastrar todas as suas chaves em um banco só. Só não dá para cadastrar uma só chave em mais de um banco.</p><p>&nbsp;</p><p>5. PRECISO TER CHAVE PIX PARA ENVIAR DINHEIRO VIA PIX?</p><p>Não. A chave Pix serve apenas para facilitar o recebimento de dinheiro. Mas se você quiser receber dinheiro sem ter uma chave Pix cadastrada, é só informar os dados bancários de sempre.</p>',null,'1637701',null,'[]',not('0'),'[]','2020-11-13 16:48:00','2020-11-13 16:48:00') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1637732,'923','1','2090','1150','<p>? Certo! Que pena que não resolvemos, neste caso vou te ajudar a abrir um chamado para que um humano entre em contato contigo</p><p>&nbsp;</p><p>Infelizmente ainda não consigo abrir protocolo por esse canal.</p><p>&nbsp;</p><p>1) Para acessar a Central Assinante clique no link https://bit.ly/central-lambda</p><p>2) Para abertura de qualquer chamado (MANUTENÇÃO, FINANCEIRO E/OU OUTROS ASSUNTOS), clicar opção Visualizar Chamados</p><p>3) Preencher o campo "Motivo da Solicitação" escrevendo o seu problema ou sua mensagem com sua solicitação, dando o máximo de detalhamento possível &nbsp;</p><p>4) Pronto! Nossa equipe te atenderá no prazo máximo de 03 dias úteis.</p>',null,'1637701',null,'[]',not('0'),'[]','2020-11-13 16:48:00','2020-11-13 16:48:00') ;
INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1637733,'923','1','1480','1210','<p>? Instalar o app é muito importante para os nossos clientes, por meio dele você pode verificar usa conexão, acessar a área do cliente e muito mais!</p><p>Para baixar o app &nbsp;da *Lambda Tecnologia* e instalar no seu celular é muito simples, basta acessar o link https://bit.ly/baixar-app-lambda</p><p>&nbsp;</p><p>Caso não tenha espaço suficiente no seu celular ou esteja usando um iPhone, pode acessar o App por este link https://bit.ly/app-lambda</p>',null,'1637701',null,'[]',not('0'),'[]','2020-11-13 16:48:00','2020-11-13 16:48:00') ;
