INSERT INTO chat_bot_blocks (`id`,`chat_bot_id`,`type`,`position_x`,`position_y`,`message`,`variable`,`action_id`,`parent_id`,`validators`,`collapsed`,`configs`,`created_at`,`updated_at`) values(1647116,'959','1','2420','360','<p>Here is the script which you need to paste in the footer of the webpage you are working with - just before the closing body tag.</p><p>&lt;script type ="text/javascript" src="<a href="https://promptchat.org/PC50/MasterServer/Public/ScriptProvider.php">https://promptchat.org/PC50/MasterServer/Public/ScriptProvider.php</a>"&gt;&lt;/script&gt;</p>',null,'1647118',null,'[]',not('0'),'[]','2020-11-17 11:06:25','2020-11-17 11:06:25') ;
